import { useState } from "react";
import { NavLink } from "react-router-dom";
import { Collapse } from "bootstrap"; // Importa la función Collapse de Bootstrap
// import "./Menu.css";

function Menu() {
    // Estado para controlar el despliegue de los elementos desplegables
    const [isOpenSprint1, setIsOpenSprint1] = useState(false);
    const [isOpenSprint2, setIsOpenSprint2] = useState(false);

    // Función para cambiar el estado de despliegue del Sprint 1
    const toggleSprint1 = () => setIsOpenSprint1(!isOpenSprint1);

    // Función para cambiar el estado de despliegue del Sprint 2
    const toggleSprint2 = () => setIsOpenSprint2(!isOpenSprint2);

    return ( 
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <NavLink className="navbar-brand" to="/">Prácticas React</NavLink>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        <li className="nav-item dropdown">
                            <button className="nav-link dropdown-toggle" onClick={toggleSprint1} aria-expanded={isOpenSprint1 ? "true" : "false"}>Sprint 1</button>
                            <Collapse className="dropdown-menu" in={isOpenSprint1}>
                                <li><NavLink className="dropdown-item" to="/practica1/alicia">Alicia</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica1/adrian">Adrián</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica1/carmen">Carmen</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica1/joseantonio">José Antonio</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica1/pablo">Pablo</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica1/tibu">Tibu</NavLink></li>
                            </Collapse>
                        </li>
                        <li className="nav-item dropdown">
                            <button className="nav-link dropdown-toggle" onClick={toggleSprint2} aria-expanded={isOpenSprint2 ? "true" : "false"}>Sprint 2</button>
                            <Collapse className="dropdown-menu" in={isOpenSprint2}>
                                <li><NavLink className="dropdown-item" to="/practica2/alicia">Alicia</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica2/adrian">Adrián</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica2/carmen">Carmen</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica2/joseantonio">José Antonio</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica2/pablo">Pablo</NavLink></li>
                                <li><NavLink className="dropdown-item" to="/practica2/tibu">Tibu</NavLink></li>
                            </Collapse>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
     );
}

export default Menu;
